css:
.github-StubItem-github-tab-controller {
  flex: 1;
  display: flex;
}
.github-GithubTabController {
  flex: 1;
  display: flex;
  flex-direction: column;
}
.github-GithubTabController-content {
  flex: 1;
  display: flex;
}
.github-GithubTabController-no-remotes {
  margin: 10px;
  font-size: 16.25px;
}
.github-GithubTabController .github-RemoteSelector {
  font-size: 16.25px;
}
.github-GithubTabController .github-RemoteSelector p {
  text-align: center;
  margin: 10px;
}
.github-GithubTabController .github-RemoteSelector ul {
  list-style: none;
  padding-left: 1em;
}
.github-GithubTabController .github-RemoteSelector a {
  color: #5293d8;
}
